function makeTab() {
	$('.tabs').each(function( index ) {
		let currentTabId = $(this).attr('id');
		$(this).find('li:not(:first)').addClass('inactive');
		let contentName = '.content' + currentTabId;
		$(contentName).hide();
		$(contentName + ':first').show();

		$(this).children('li').click(function() {
			let t = $(this).attr('id');
			if($(this).hasClass('inactive')){
				$(this).parent().find('li').addClass('inactive');
				$(this).removeClass('inactive');
				$(contentName).hide();
				$('#'+ t + 'Tab').fadeIn('slow');
			}
		});
	});
}
makeTab();


function dropDown() {
	let dropdownGroup = document.querySelectorAll('.dropdown-group');
	dropdownGroup.forEach((elm , index) => {
		selectBtn = elm.querySelector('.js-dropdown-btn');

		if(selectBtn) {
			selectBtn.addEventListener('click', () => {
				elm.classList.toggle('active');

				for(let [el, value] of dropdownGroup.entries()) {
					if(el !== index) {
						value.classList.remove('active');
					}
        }
			})
		}

		// When user click outsize close dropDown
		$(document).on('click', function(event) {
			if (!$(event.target).closest('.dropdown-content').length && !$(event.target).closest('.dropdown-group').length) {

				for(let elem of dropdownGroup) {
					elem.classList.remove('active');
        }
			}
		});
	})
}
dropDown();

function makeRange() {
	let elems = document.querySelectorAll('.rangeOne, .rangeTwo'),
	currentWidth = screen.width;

	elems.forEach(function(elem, index) {

		function updateView() {
			if (elem.getAttribute('name') === 'rangeOne') {
				startVal = elem.value;
				let parentElm = elem.parentElement;
				let outputOneElm = parentElm.querySelector('.outputOne');
				outputOneElm.innerHTML = elem.value;
				outputOneElm.style.left = (elem.value / 60 * 100) * (currentWidth > 991 ? (240 - 15) : (currentWidth - 47)) / 100 + 'px';
			} else if (elem.getAttribute('name') === 'rangeTwo') {
				endVal = elem.value;
				let parentElm = elem.parentElement;
				let outputTwoElm = parentElm.querySelector('.outputTwo');
				outputTwoElm.innerHTML = elem.value;
				outputTwoElm.style.left = (elem.value / 60 * 100) * (currentWidth > 991 ? (240 - 15) : (currentWidth - 47)) / 100 + 'px';
			}
		}
		updateView();

		elem.addEventListener('input', function() {
			updateView();
		});
	})
}
makeRange();

function slideDropDown() {
	$('.header-slide').each(function() {
    $(this).on("click", function(){
			$(this).siblings('.header-slide-content').slideToggle();
			$(this).find('.header-slide__img').toggleClass('rotateImg');
    });
	});
}
slideDropDown();

function toggleFilter() {
	$('.filter-mb').click(function() {
		$('.filter-area').toggleClass('showFilter');
		$('.filter-crypto').toggleClass('showCrypto');
		$('body').toggleClass('hiddenElm');
		$('.overlay').toggleClass('showDiv');
	})

	$('.overlay ').click(function(evt){
		if(evt.target.id == 'filter-area')
			 return;
		if($(evt.target).closest('#filter-area').length)
			 return;

	 $('.filter-area').removeClass('showFilter');
	 $('.filter-crypto').removeClass('showCrypto');
		$('body').removeClass('hiddenElm');
		$('.overlay').removeClass('showDiv');
	});
	// For history toggle
	$('.mobile-item').click(function() {
		$('.history-area').toggleClass('showHistory');
		$('body').toggleClass('hiddenElm');
		$('.overlay').toggleClass('showDiv');
	})

	$('.overlay ').click(function(evt) {
		if(evt.target.id == 'history-area')
			 return;
		if($(evt.target).closest('#filter-area').length)
			 return;

	 $('.history-area').removeClass('showHistory');
		$('body').removeClass('hiddenElm');
		$('.overlay').removeClass('showDiv');
	});
}
toggleFilter()

function makeModal() {
	const modals = document.querySelectorAll('[data-modal]');

	modals.forEach(function (trigger) {
		trigger.addEventListener("click", function (event) {
			event.preventDefault();
			const modal = document.getElementById(trigger.dataset.modal);
			modal.classList.add('open');
			$('body').toggleClass('hiddenElm');
			const exits = modal.querySelectorAll('.modal-exit');
			exits.forEach(function (exit) {
				exit.addEventListener("click", function (event) {
					event.preventDefault();
					modal.classList.remove('open');
					$('body').toggleClass('hiddenElm');
				});
			});
		});
	});

	const exits = document.querySelectorAll('.modal-exit');
	exits.forEach(function (exit) {
		exit.addEventListener("click", function (event) {
			event.preventDefault();
			// modal.classList.remove('open');
			$(this).parent()[0].classList.remove('open');
			// console.log('this', $(this))
		});
	});
}
makeModal();

function loadingModal() {
	$(document).ajaxSend(function() {
		$('.overlay').fadeIn(300);
	});

	$('.js-show-loading').click(function() {
		$.ajax({
			type: 'GET',
			// url: 'https://reqres.in/api/users',
			// dataType: 'json',
			success: function(data){
				console.log(data);
			}
		}).done(function() {
			setTimeout(function(){
				$('.overlay').fadeOut(500);
				$('#modal-success')[0].classList.add('open')
			},1000);
		}).fail(function(xhr, status, error) {
			// console.log(error.responseJSON)
			setTimeout(function(){
				$('.overlay').fadeOut(500);
			},1000);
		});
	});
}
