function validateForm() {
	let flagEmail = false,
	checkBox = false,
	enterCode = false;

	$('.checkbox-inner__input--term').change(function() {
		if (this.checked) {
			checkBox = true;
			if (enterCode && flagEmail) {
				$('.button--create').removeAttr('disabled');
			}
		} else if (this.checked && flagEmail) {
			console.log('222')
			checkBox = true;
			$('.button--create').removeAttr('disabled')
    } else {
			checkBox = false;
			$('.button--create').prop('disabled', true);
		}
});

const formInputs = document.querySelectorAll('.create-form__input');
if (formInputs) {
	formInputs.forEach(function (formInput) {
		formInput.addEventListener('input', (e) => {
			if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(e.target.value)) {
				console.log('111')
				$('.send-code__btn').removeAttr('disabled');
				flagEmail = true;
			} else {
				console.log('222')
				$('.send-code__btn').prop('disabled', true);
				flagEmail = false;
			}
		})
	});
}

const sendCodeInputs = document.querySelectorAll('.send-code__input');
	if(sendCodeInputs) {
		sendCodeInputs.forEach(function (sendCodeInput) {
			sendCodeInput.addEventListener('input', (e) => {
				if (e.target.value.length) {
					enterCode = true;
					if (flagEmail && checkBox ) {
						$('.button--create').removeAttr('disabled');
					}
				}  else if (e.target.value.length && flagEmail && checkBox) {
					enterCode = true;
					$('.button--create').removeAttr('disabled');
				} else {
					enterCode = false;
					$('.button--create').prop('disabled', true);
				}
			})
		});
	}
}
validateForm();
